import React from 'react';

function Dashboard() {
    return (
        <div style={{ textAlign: 'center', marginTop: '50px' }}>
            <h1>Welcome to the Dashboard!</h1>
            <p>You have successfully logged in.</p>
        </div>
    );
}

export default Dashboard;
